{
  data++;
  return data;
}

function fun1()
{
  data--;
  return data;
}

function App() {
    return (
      <div>
      <p>My Age is </p>
      <button onClick = {fun()}> in </button>
      <button onClick = {fun1()}> de </button>
      </div>
    );
}

export default App;
